@OpenAI TODOs? https://t.co/DEFUgGzpJI

Oportunidade como Cientista de Dados (Home Office).

Principais Requisitos:

- Conhecimento aprofundado de machine learning: Tratamento de dados desbalanceados, modelos clássicos e avançados de machine learning, modelos não supervisionados, técnicas de ensemble e PLN;

- Experiência em função relacionada a ciência de dados e/ou - estatística;

- Conhecimento em estatística: testes de hipóteses, dimensionamento de amostra;

- Experiência em Python intermediário e SQL avançado;

- Experiência em validação de modelo;

- Exploração de dados, feature engineering, tunning de hiperparâmetros, criação de datasets para modelagem;

- Serving de modelos;

- Ferramentas de controle de versionamento (Git);

- Experiência com Big Data (Spark, Hive).

Diferenciais:

- Séries temporais, métodos de otimização e pesquisa operacional;

- Experiência em projetos de ciência de dados no mercado financeiro;

- Experiência com automação do pipeline de Data Science (Airflow, Databricks).

Detalhes na Timeline da Comunidade DSA:

https://t.co/dtBeNmOVDx

